import { expect } from 'chai';
import request from 'supertest';
import mongoose from 'mongoose';
import HttpStatus from 'http-status-codes';

import app from '../../src/index';

let token;
let id;

describe('User APIs Test', () => {
  before((done) => {
    const clearCollections = () => {
      for (const collection in mongoose.connection.collections) {
        mongoose.connection.collections[collection].deleteOne(() => {});
      }
    };

    const mongooseConnect = async () => {
      await mongoose.connect(process.env.DATABASE_TEST);
      clearCollections();
    };

    if (mongoose.connection.readyState === 0) {
      mongooseConnect();
    } else {
      clearCollections();
    }

    done();
  });

  describe('POST/users ', () => {
    it('Given valid user details it should return Created', (done) => {
      const userDetails = {
        firstName: 'navitha',
        lastName: 'posam',
        email: 'navitha157@gmail.com',
        password: 'navitha@157#'
      };
      request(app)
        .post('/api/v1/users')
        .send(userDetails)
        .end((err, res) => {
          expect(res.statusCode).to.be.equal(HttpStatus.CREATED);
          done();
        });
    });
  });

  describe('POST/users/login', () => {
    it('given valid User Login details it should return 200', (done) => {
      const userDetails = {
        email: 'navitha157@gmail.com',
        password: 'navitha@157#'
      };
      request(app)
        .post('/api/v1/users/login')
        .send(userDetails)
        .end((err, res) => {
          token = res.body.data;
          expect(res.statusCode).to.be.equal(HttpStatus.OK);
          done();
        });
    });
  });
  // // Note
  //create note
  describe('POST/notes ', () => {
    it('Given valid NOTE details it should return Created', (done) => {
      const noteDetails = {
        title: 'Hello bridzelabz',
        description: '...welcome to nodejs...'
      };
      request(app)
        .post('/api/v1/notes')
        .set('Authorization', `Bearer ${token}`)
        .send(noteDetails)
        .end((err, res) => {
         id = res.body.data._id;
          expect(res.statusCode).to.be.equal(HttpStatus.CREATED);
          done();
        });
    });
  });
  //get all notes
  describe('GET/notes', () => {
    it('Given valid details and fetch all notes it should return OK', (done) => {
      request(app)
        .get('/api/v1/notes')
        .set('Authorization', `Bearer ${token}`)
        .end((err, res) => {
          expect(res.statusCode).to.be.equal(HttpStatus.OK);
          done();
        });
    });
  });
  //get single note
  describe('GET/notes/:_id', () => {
    it('Given valid details and fetch notes it should return OK', (done) => {
      request(app)
        .get(`/api/v1/notes/${id}`)
        .set('Authorization', `Bearer ${token}`)
        .end((err, res) => {
          expect(res.statusCode).to.be.equal(HttpStatus.OK);
          done();
        });
    });
  });

  //update note
  describe('PUT/notes/:_id ', () => {
    it('Given UPDATE details get updated one it should return ACCEPTED', (done) => {
      const noteDetails = {
        title: 'Hello NODEJS',
        description: '...welcome to nodejs...'
      };
      request(app)
        .put(`/api/v1/notes/${id}`)
        .set('Authorization', `Bearer ${token}`)
        .send(noteDetails)
        .end((err, res) => {
          expect(res.statusCode).to.be.equal(HttpStatus.ACCEPTED);
          done();
        });
    });
  });


    //Trash 
   describe('PUT/notes/trash/:_id ', () => {
    it('Given details get updated one it should return ACCEPTED', (done) => {
      console.log("TEST ......" );
      request(app)
        .put(`/api/v1/notes/trash/${id}`) 
        .set('Authorization', `Bearer ${token}`)
        .end((err, res) => {
          expect(res.statusCode).to.be.equal(HttpStatus.ACCEPTED);
          done();
        });
    });
  });

  //ARCHIVE 
  describe('PUT/notes/archive/:_id', () => {
    it('Given details get updated one it should return ACCEPTED', (done) => {
      request(app)
        .put(`/api/v1/notes/archive/${id}`)
        .set('Authorization', `Bearer ${token}`)
        .end((err, res) => {
          expect(res.statusCode).to.be.equal(HttpStatus.ACCEPTED);
          done();
        });
    });
  });

  //delete note
  describe('DELETE/notes/:_id ', () => {
    it('Given ID it deletes the note and it should return OK', (done) => {
      request(app)
        .delete(`/api/v1/notes/${id}`)
        .set('Authorization', `Bearer ${token}`)
        .end((err, res) => {
          expect(res.statusCode).to.be.equal(HttpStatus.OK);
          done();
        });
    });
  });

 });

